>payload.code</script>\",\n\"message\": \"<script bizType0=\"ORDER_CANCEL\" bizField=\"Msg\" defaultValue=\"gateway-内部错误\">payload.message</script>\"\n},\n\"body\": \"<encrypt>{\n\"orderId\":\"<script>payload.tntOrderId</script>\",\n\"productName\":\"<script>payload.productName</script>\",\n\"orderAmount\":\"<script>payload.orderAmount</script>\"\n}</encrypt>\"\n}', 'cancelOrder', 'payload.body.operation', 'payload.body.partner', null, '2019-01-04 16:34:23');
