INSERT INTO `sas_interface` VALUES ('41', '创建订单', 'selfOrderService', 'dubbo', null, 'cop-sas-scenic-order', 'com.lvmama.cop.sas.scenic.order.api.service.CopCreateOrderService', 'createOrder', '0', '20', 'OUTERTOINNER', '郝菲菲', '1', '0', '5', null, null, '2019-01-16 18:32:41', '2019-01-16 18:32:41', null, null, null, null, '', '', '', '', '', 'payload.body.header.sign', 'MD5', 'payload.body.header.accountId+payload.body.header.serviceName+payload.body.header.requestTime+payload.body.body+payload.body.header.version+\'dd93d72583a0653be0273125bd7f99cb\'', 'Json', null, null, '<request>\n    <param type=\"com.lvmama.cop.sas.scenic.order.api.request.CopCreateOrderRequest\">\n        <copCreateOrderRequest>\n            <appkey>CTRIP_JINGWAI_TICKET</appkey>\n            <booker>\n                <email>\n                    <script>payload.body.body.contacts[0].email</script>\n                </email>\n                <mobile>\n                    <script>payload.body.body.contacts[0].intlCode==\'86\'? payload.body.body.contacts[0].mobile:payload.body.body.contacts[0].optionMobile</script>\n                </mobile>\n                <name>\n                    <script>payload.body.body.contacts[0].name</script>\n                </name>\n            </booker>\n            <expressage>\n                <address>\n                    <script>payload.body.body.items[0].expressDelivery.address</script>\n                </address>\n                <contactNumber>\n                    <script>payload.body.body.items[0].expressDelivery.mobile</script>\n                </contactNumber>\n                <postcode></postcode>\n                <recipients>\n                    <script>payload.body.body.items[0].expressDelivery.name</script>\n                </recipients>\n            </expressage>\n            <extraInfo>\n                <itemId>\n                    <script>payload.body.body.items[0].itemId</script>\n                </itemId>\n            </extraInfo>\n            <orderAmount>\n                <script>payload.body.body.items[0].price+\'\'</script>\n            </orderAmount>\n            <orderSellAmount>\n                <script>payload.body.body.items[0].cost+\'\'</script>\n            </orderSellAmount>\n            <partneSingleSource>\n                <script>VST</script>\n            </partneSingleSource>\n            <partnerOrderNo>\n                <script>payload.body.body.otaOrderId</script>\n            </partnerOrderNo>\n            <product>\n                <b2bPrice>\n                    <script>payload.body.body.items[0].cost+\'\'</script>\n                </b2bPrice>\n                <goodsId>\n                    <script>payload.body.body.items[0].PLU.substring(payload.body.body.items[0].PLU.lastIndexOf(\"_\")+1)+\'\'</script>\n                </goodsId>\n                <productId>\n                    <script>payload.body.body.items[0].PLU.substring(0, payload.body.body.items[0].PLU.indexOf(\'_\'))+\'\'</script>\n                </productId>\n                <quantity>\n                    <script>payload.body.body.items[0].quantity+\'\'</script>\n                </quantity>\n                <sellPrice>\n                    <script>payload.body.body.items[0].cost+\'\'</script>\n                </sellPrice>\n                <visitDate>\n                    <script>payload.body.body.items[0].useStartDate</script>\n                </visitDate>\n            </product>\n            <requestIp>\n                <script>payload.header.realIP</script>\n            </requestIp>\n            <travellers>\n                <foreach collection=\"payload.body.body.items[0].passengers\">\n                    <birthday>\n                        <script>#item.birthDate</script>\n                    </birthday>\n                    <credentials>\n                        <script>#item.cardNo</script>\n                    </credentials>\n                    <credentialsType>\n                        <script>#item.cardType</script>\n                    </credentialsType>\n                    <email>\n                        <script>#item.email</script>\n                    </email>\n                    <enName>\n                        <script>#item.firstName+#item.lastName</script>\n                    </enName>\n                    <mobile>\n                        <script>#item.mobile</script>\n                    </mobile>\n                    <name>\n                        <script>#item.name</script>\n                    </name>\n                    <pinyin>\n                        <script></script>\n                    </pinyin>\n                </foreach>\n            </travellers>\n        </copCreateOrderRequest>\n    </param>\n</request>', 'resultCode:<script>payload.code</script>\nresultMessage:<script>payload.message</script>', '{\n\"header\":{\n\"resultCode\":\"<script bizType=\"ORDER_CRATE\" defaultValue=\"1100\" bizField=\"Code\">payload.code</script>\",\n\"resultMessage\":\"<script bizType=\"ORDER_CRATE\" defaultValue=\"订单异常，创建失败\" bizField=\"Msg\">payload.code</script>\"\n},\n\"body\":\"<encrypt>{\n\"otaOrderId\":\"<script>payload.orderInfo.partnerOrderId</script>\",\n\"supplierOrderId\":\"<script>payload.orderInfo.supplyOrderId</script>\",\n\"supplierConfirmType\":\"<script>payload.orderInfo.goodsType==\'EXPRESSTYPE_DISPLAY\'?1:2</script>\",\n\"voucherSender\":\"<script>payload.orderInfo.goodsType==\'EXPRESSTYPE_DISPLAY\'?1:2</script>\",\n\"vouchers\":[{\n\"itemId\":\"<script>payload.orderInfo.itemId</script>\",\n\"voucherType\":\"<script>payload.orderInfo.goodsType==\'EXPRESSTYPE_DISPLAY\'?1:\'\'</script>\",\n\"voucherCode\":\"\",\n\"voucherData\":\"\"\n}],\n\"items\":[{\n\"itemId\":\"\",\n\"inventorys\":[{\n\"useDate\":\"\",\n\"quantity\":\"\"\n}]\n}]\n}</encrypt>\"\n}', '', '', 'payload.body.body', null, '2019-01-16 18:26:57');
